import React from 'react';
import CDropdown from '@coreui/react'
function DropDown() {
  const options = [
    {
      value: 0,
      text: 'Monday',
    },
    {
      value: 1,
      text: 'Tuesday',
    },
    {
      value: 2,
      text: 'Wednesday',
    },
    {
      value: 3,
      text: 'Thuirsday',
    },
    {
        value: 4,
        text: 'Friday',
      },
      {
        value: 4,
        text: 'Saturday',
      },
   
  ];

  return (
    <>
      <CDropdown options={options} label="Framework" text="Please select your framework." />
    </>
  );
}

export default DropDown;
